import Note from "./Note";

// Set the note object's doesMatchSearch property to true if there is matching text and false if not. Hint: the following two string methods can be very helpful in writing this event handler:
// .toLowerCase()(opens in a new tab) string method(opens in a new tab) which makes all text lowercase.
// .includes()(opens in a new tab) string method(opens in a new tab), which will search a string or group of strings for matching text.
// Add an onChange event listener to the Header's text input.
// Use props to pass a reference to the onSearch method from App down to the text input element's onChange event listener.

const NotesList = (props) => {
  const renderNote = (note) => <Note note={note} key={note.id} onType={props.onType}/>


  const noteElement = props.notes.map(renderNote);
  return   <ul className="notes-list">{noteElement}</ul>

};

export default NotesList;
